import * as S from './DetailTitle.style';

// custom hoosk
import { useGetPortfolio } from '../../hooks/useGetPortfolio';
import { useParams } from 'react-router-dom';
import Portfolio from '../User/Portfolio';

type LinkName = readonly [string, string];

type DetailTileProps = {
  title: string;
  name: string;
  gitLink: string;
  distributionLink: string;
  skills: string[];
};
// 상세 페이지 포트폴리오 제목 및 사용자 정보
function DetailTitle({ name, title, gitLink, distributionLink }: DetailTileProps) {
  // !: userId를 뽑아서 줘야 한다.
  // const { portfolioId } = useParams();

  // const { getPortfolioLoading, getPortfolioError, PortfolioInfo } = useGetPortfolio(
  //   Number(portfolioId),
  // );
  // console.log('data', PortfolioInfo);
  const dummy = ['JAVA', 'Spring'];
  const linkName: LinkName = ['깃헙링크', '배포링크'];

  return (
    <S.DetailTitle>
      <S.TitleUpper>
        <S.ProjectTitle>{title}</S.ProjectTitle>
        <S.UserInfo>
          <S.userName>{name}</S.userName>
          <S.userImg></S.userImg>
        </S.UserInfo>
      </S.TitleUpper>
      <S.TitleDowner>
        <S.Links>
          {linkName.map((name, idx) => {
            if (name === '깃헙링크') {
              return (
                <S.Link key={idx} darkGrey={true}>
                  {name}
                </S.Link>
              );
            }
            return (
              <S.Link key={idx} href={''}>
                {name}
              </S.Link>
            );
          })}
        </S.Links>
        <S.Tags>
          {dummy.map((tag, idx) => {
            return <S.YellowTagCutsom key={idx}>{tag}</S.YellowTagCutsom>;
          })}
        </S.Tags>
      </S.TitleDowner>
    </S.DetailTitle>
  );
}

export default DetailTitle;
